import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { PrimeReactProvider } from 'primereact/api';

// Selecciona el elemento HTML al que deseas adjuntar el shadow DOM
const root = document.getElementById('root');

// Crea el shadowRoot y obtén una referencia al nodo donde se adjuntará
const shadowRoot = root.attachShadow({ mode: 'open' });
const mountHere = document.createElement('div');
shadowRoot.appendChild(mountHere);

const options = { appendTo: mountHere, styleContainer: mountHere };

ReactDOM.createRoot(mountHere).render(
  <React.StrictMode>
    <PrimeReactProvider value={options}>
      <App />
    </PrimeReactProvider>
  </React.StrictMode>,
);
